\begin{lemma}\label{lem:2}
Let $f$ be a function defined on $[0,1]$ such that $f(0)=0$ and $f(1)=1$. Then there exists a sequence of polynomials $p_n$ such that $p_n$ converges uniformly to $f$ on $[0,1]$ and $\deg(p_n) \leq n$ for all $n$.
\end{lemma}

\begin{proof}
We will prove this by induction on $n$. The base case $n=0$ is trivial. Suppose that the statement is true for some $n$. We will show that it is true for $n+1$. Let $f$ be a function that satisfies the conditions of the statement. Let $p_n$ be a polynomial of degree at most $n$ that approximates $f$ uniformly on $[0,1]$. We will construct a polynomial $p_{n+1}$ of degree at most $n+1$ that approximates $f$ uniformly on $[0,1]$.

Let $p_{n+1}(x) = p_n(x) + a_n(x-x_0)^{n+1}$, where $a_n$ is a constant to be determined and $x_0$ is a point in $[0,1]$. We want to choose $a_n$ and $x_0$ so that $p_{n+1}$ approximates $f$ better than $p_n$ does. We will choose $x_0$ to be the point in $[0,1]$ where $f(x_0) - p_n(x_0)$ is maximized. Then we will choose $a_n$ to be the slope of the line through $(x_0,f(x_0))$ and $(1,f(1))$. This will ensure that $p_{n+1}$ is a better approximation to $f$ than $p_n$.

To see why this works, let $g(x) = f(x) - p_n(x)$. Then $g(x_0) \geq g(x)$ for all $x \in [0,1]$. Thus, $g(x_0) \geq \max_{x \in [0,1]} g(x)$. Let $a_n$ be the slope of the line through $(x_0,f(x_0))$ and $(1,f(1))$. Then $p_{n+1}(x) = p_n(x) + a_n(x-x_0)^{n+1}$ satisfies $p_{n+1}(x_0) = f(x_0)$ and $p_{n+1}(1) = f(1)$. Moreover, for any $x \in [0,1]$,
\begin{align*}
|f(x) - p_{n+1}(x)| &= |g(x) - a_n(x-x_0)^{n+1}| \\
&\leq |g(x)| + |a_n(x-x_0)^{n+1}| \\
&\leq |g(x_0)| + |a_n(x_0-x)^{n+1}| \\
&= |f(x_0) - p_n(x_0)| + |a_n(x_0-x)^{n+1}| \\
&\leq |f(x_0) - p_n(x_0)| + |a_n| \\
&\leq |f(x_0) - p_n(x_0)| + \frac{\epsilon}{2}.
\end{align*}
Thus, if we choose $a_n$ such that $|a_n| < \frac{\epsilon}{2}$, then we have $|f(x) - p_{n+1}(x)| < \epsilon$ for all $x \in [0,1]$. Therefore, $p_{n+1}$ is a polynomial of degree at most $n+1$ that approximates $f$ uniformly on $[0,1]$. By induction, we can construct a sequence of polynomials $p_n$ that converges uniformly to $f$ on $[0,1]$.
\end{proof}

\begin{proof}[Proof of Theorem \ref{thm:main}]
Let $f$ be a continuous function on $[0,1]$. We will show that $f$ is uniformly continuous on $[0,1]$ if and only if for every $\epsilon > 0$, there exists a polynomial $p$ such that $\|f-p\|_\infty < \epsilon$ and $\deg(p) \leq n$ for some $n \in \mathbb{N}$.

$(\Rightarrow)$ Suppose $f$ is uniformly continuous on $[0,1]$. Let $\epsilon > 0$ be given. By the definition of uniform continuity, there exists a $\delta > 0$ such that $|f(x) - f(y)| < \epsilon$ whenever $|x-y| < \delta$. Let $n$ be the smallest integer such that $\frac{1}{2^n} < \delta$. Then, by the Weierstrass Approximation Theorem, there exists a polynomial $p$ of degree at most $n$ such that $\|f-p\|_\infty < \epsilon$. Therefore, for any $\epsilon > 0$, there exists a polynomial $p$ such that $\|f-p\|_\infty < \epsilon$ and $\deg(p) \leq n$.

$(\Leftarrow)$ Suppose that for every $\epsilon > 0$, there exists a polynomial $p$ such that $\|f-p\|_\infty < \epsilon$ and $\deg(p) \leq n$ for some $n \in \mathbb{N}$. Let $\epsilon > 0$ be given. Then there exists a polynomial $p$ such that $\|f-p\|_\infty < \frac{\epsilon}{2}$. By the triangle inequality, we have
\[|f(x) - f(y)| \leq |f(x) - p(x)| + |p(x) - p(y)| + |p(y) - f(y)| < \epsilon\]
whenever $|x-y| < \delta$, where $\delta = \frac{\epsilon}{2\|p\|_\infty}$. Thus, $f$ is uniformly continuous on $[0,1]$.
\end{proof}

