To add 53 and 61 in base-8, we can start by adding the ones place digits, which gives us 3+1=4. We then move on to the eights place digits, which gives us 5+6=13. However, since we are in base-8, we need to regroup this as 13=1*8+5. So we write down the 5 in the eights place and carry the 1 over to the next place. Finally, we add the carried 1 to the next place, which gives us 1+5+6=12. Again, we need to regroup this as 12=1*8+4. So we write down the 4 in the sixty-fours place and carry the 1 over to the next place. Since there are no more places to add, we have our final result:

53+61=114

\boxed{114}

